import React, { Component, Fragment} from 'react';
import Data from './OverdueData.json';
import SearchResultNum from '../search/SearchResultNum';
import SearchResultNone from '../search/SearchResultNone';
import SearchResultItem from '../search/SearchResultItem';

class Overdue extends Component{

	async getOverdueResult(){
		const response = await axios.get(
			'http://localhost:3000/overdue'
		);
		return (response);
	}

	componentDidMount() {
		this.getBookInfo().then(
			info => this.setState(
				{
					data:	info.data.data
				}
			)
		)
	}

	render() {
		let searchResult;
		if (Data.count === 0)
			searchResult = <SearchResultNone />
		else
			searchResult = <SearchResultItem Data = {Data.data}/>

		const blankSpaceStyle={
			position: "relative",
			width: "70%",
			textAlign: "left",
			margin: "0 auto",
			marginTop: "170px"
		}

		return (
			<Fragment>
				<div style={blankSpaceStyle}></div>
				<SearchResultNum count = {Data.count}/>
				{searchResult}
			</Fragment>
		);
	}
}

export default Overdue;
